import React from 'react';
import logo from './airbnb-1.svg';
import './NavBar.css';

const NavBar = () => {
	return (
		<header id='navbar'>
			<nav>
				<div className='container'>
					<img
						className='logo'
						src={logo}
						alt='AirBnB'
					/>
				</div>
			</nav>
		</header>
	);
};

export default NavBar;
